import ReturnMsg from './Msg';


// Register Main Success
export default function ReturnRegisterSuccess() {
 return (
  <div className='wrp-succes-register'>

   <ReturnTitle />
   {/* <REturnLogo /> */}
   {/* <REturnQuOte /> */}
   <ReturnBtn />
   <ReturnIconSuccess />
